import React, { useEffect } from "react";
import { useRouter } from "next/router";
import Splash from "../components/Splash";

const Page = () => {
  const router = useRouter();
  useEffect(() => {
    let content = <p>Loading...</p>;
  });
  content = <Splash />;
  return content;
};

export default Page;
